  assemblies:
  - dotNetRDF
  namespace: VDS.RDF
  summary: "\nA Function which attempts to reduce a Uri to a QName.\n"
  remarks: This function will return a Boolean indicated whether it succeeded in reducing the Uri to a QName.  If it did then the out parameter qname will contain the reduction, otherwise it will be the empty string.
  example: []
  syntax:
    content: public override bool ReduceToQName(string uri, out string qname)
    parameters:
    - id: uri
      type: System.String
      description: The Uri to attempt to reduce.
    - id: qname
      type: System.String
      description: The value to output the QName to if possible.
    return:
      type: System.Boolean
      description: ''
    content.vb: Public Overrides Function ReduceToQName(uri As String, ByRef qname As String) As Boolean
