    path: Libraries/dotNetRDF/Core/NamespaceMapper.cs
    startLine: 516
  assemblies:
  - dotNetRDF
  namespace: VDS.RDF
  summary: "\nA Function which attempts to reduce a Uri to a QName and issues a Temporary Namespace if required.\n"
  remarks: "\n<p>\nThis function will always returns a possible QName for the URI if the format of the URI permits it.  It doesn&apos;t guarentee that the QName will be valid for the syntax it is being written to - it is up to implementers of writers to validate the QNames returned.\n</p>\n<p>\nWhere necessary a Temporary Namespace will be issued and the <code data-dev-comment-type=\"paramref\" class=\"paramref\">tempNamespace</code> parameter will be set to the prefix of the new temporary namespace.\n</p>\n"
  example: []
  syntax:
    content: public bool ReduceToQName(string uri, out string qname, out string tempNamespace)
    parameters:
    - id: uri
      type: System.String
      description: The Uri to attempt to reduce.
    - id: qname
      type: System.String
      description: The value to output the QName to if possible.
    - id: tempNamespace
      type: System.String
      description: The Temporary Namespace issued (if any).
    return:
      type: System.Boolean
      description: ''
    content.vb: Public Function ReduceToQName(uri As String, ByRef qname As String, ByRef tempNamespace As String) As Boolean
